css:
.editor-colors {
  background-color: #fff;
  color: #000;
}
.editor .invisible-character,
.editor .indent-guide,
.editor .invisible,
.editor .wrap-guide {
  color: #dfdfdf;
}
.editor .selection .region {
  background-color: #dfdfdf;
}
.editor .gutter .line-number:after,
.editor .gutter .line-number.folded,
.editor .folded-marker:after {
  color: #c17d11;
}
.editor .gutter {
  color: #aaa;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(223, 223, 223, 0.4);
}
.editor.is-focused .cursor {
  border-color: #000;
}
.editor .gfm .link,
.editor .gfm .variable.list,
.editor .gfm .markup.heading,
.editor .gfm .link .entity,
.editor .gfm .entity {
  color: #204a87;
}
.editor .gfm .hr,
.editor .gfm .quote {
  color: #aaa;
}
.editor .gfm .issue {
  color: #a40000;
}
.editor .search-results .marker.current-result .region,
.editor .search-results .marker .region,
.editor .current-result .region,
.editor .find-result .region {
  border: 1px solid #000;
}
.bracket-matcher {
  background-color: #dfdfdf;
}
.comment {
  color: #aaa;
  font-style: italic;
}
.invalid,
.invalid.depricated {
  color: #fef104;
  background-color: #c17d11;
}
.source .string,
.string {
  color: #a40000;
}
.string .source,
.string .meta.embedded.line {
  color: #000;
}
.string .punctuation.end,
.string .punctuation.begin,
.string .punctuation.section.embedded,
.string .punctuation.end .source,
.string .punctuation.begin .source,
.string .punctuation.section.embedded .source {
  color: #a40000;
}
.constant.character,
.constant.other {
  color: #4e9a06;
}
.constant.numeric {
  color: #00aaaa;
}
.constant.symbol {
  color: #5c3566;
}
.constant.language {
  color: #000;
}
.variable {
  color: #00aaaa;
}
.variable.parameter {
  color: #000;
}
.keyword {
  color: #000;
}
.keyword.unit {
  color: #a40000;
}
.keyword.special-method {
  color: #000;
}
.storage,
.storage.type {
  color: #000;
}
.entity.other.inherited-class {
  color: #5c3566;
}
.entity.name.tag,
.entity.other.attribute-name {
  color: #00aaaa;
}
.entity.name.function {
  color: #204a87;
}
.entity.name.class {
  color: #4e9a06;
}
.support.constant,
.support.function,
.support.type {
  color: #000;
}
.support.class {
  color: #4e9a06;
}
.source.json .string.quoted.double,
.source.json .string.quoted.double .punctuation {
  color: #00aaaa;
}
.source.json .value .string.quoted.double,
.source.json .value .string.quoted.double .punctuation {
  color: #a40000;
}
.source.yaml .string.quoted.double,
.source.yaml .string.quoted.double .punctuation {
  color: #a40000;
}
.source.yaml .leading-whitespace + .string.double.quoted.double,
.source.yaml .leading-whitespace + .string.double.quoted.double .punctuation {
  color: #00aaaa;
}
.source.css .support.property-name {
  color: #000;
}
.source.css .constant {
  color: #00aaaa;
}
.source.css .constant.numeric {
  color: #a40000;
}
.text.html .punctuation.tag.begin,
.text.html .punctuation.tag.end {
  color: #00aaaa;
}
.source.ruby .keyword {
  font-weight: bold;
}
